import React from "react";
import swim from '../images/swim.png'


const Card = () => {
     return (
         <div className='card'>
             <img src={swim} className='card--image' alt=''/>
             <div className='card--stats'>
                 <img src='../images/star.png'/>
             </div>
         </div>
     )
}

export default Card;
